'''Created on 30 05 2021@author: Enzo Cocca'''from builtins import objectclass SHIPWRECK_POINT(object):    # def __init__"    def __init__(self,                 gid,                 the_geom,                                  code,                 nationality,                 name_vessel                 ):        self.gid = gid  # 0        self.the_geom = the_geom  # 2        self.code=code        self.nationality=nationality        self.name_vessel=name_vessel    # def __repr__"    def __repr__(self):        return "<SHIPWRECK_POINT('%d','%s', '%s',%s,'%s')>" % (            self.gid ,            self.the_geom ,            self.code,            self.nationality,            self.name_vessel,        )